import { Link } from "react-router-dom";

export default function Header() {

    return(
    <header>
      <Link to="/" className="logo">Главная</Link>
      <nav>
            <>
                <Link to="/create">Create new post</Link>
            </>
      </nav>
    </header>
    )
}
